import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import './index.css';
import reportWebVitals from './reportWebVitals'; // Importing the reportWebVitals file

// Rendering the App component to the DOM
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// This will call the reportWebVitals function to measure performance
reportWebVitals();
